import React from 'react';
import {HStack, VStack,Text,IconButton} from '@chakra-ui/react';
import { FaTrash } from 'react-icons/fa';
function TodoLIst() {

    const todos=[
        {
            id:1,
            body:'get bread',
        },
        {
            id:2,
            body:'learn react',
        },
    ];

    return (
        <VStack>
            {todos.map(todo =>(
                <HStack>
                    <Text>{todo.body}</Text>
                    <IconButton icon={<FaTrash/>}/>
                </HStack>
            ))}
        </VStack>
    );
}

export default TodoLIst;
